import { useState, useEffect } from "react";

export const GifGrid = ({ category }) => {

  const [images, setImages] = useState()

  useEffect(() => {
    getGifs();
  }, [])

  const getGifs = async() => {

    const resp = await fetch("http://api.giphy.com/v1/gifs/search?api_key=9arW6eCRyGoNPsWcpr6qEQhySBlUdcqu&q=rick&limit=10");
    const { data } = await resp.json();

    const gifs = data.map( img => {
      return {
        id: img.id,
        title: img.title,
        url: img.images?.downsized_medium.url
      }
    } )

    console.log(gifs);
    setImages(gifs);

  }

  return (
    <>
      <h3>{ category }</h3>
      <ol>
        <li>Item</li>
      </ol>
    </>
  )
}
